auth_info:
- ? information_source; https://docs.ray.io/en/latest/ray-overview/examples/e2e-multimodal-ai-workloads/notebooks/03-Online-Serving.html
  : - 'The service requires Bearer token authentication. Include the Authorization
      header with the format "Authorization: Bearer <BEARER_TOKEN>" in all requests
      to the service endpoint. Replace <BEARER_TOKEN> with your actual bearer token
      value.'
- information_source; https://docs.ray.io/en/latest/data/working-with-llms.html:
  - OpenAI-compatible endpoints require Bearer token authentication. Send the API
    key in the Authorization header as "Bearer {OPENAI_API_KEY}", where OPENAI_API_KEY
    is retrieved from the environment variable OPENAI_API_KEY.
